import qs from 'qs';
import axios from 'axios';

const Search = () => {
    const [keyword, setKeyword] = useState('');

    const handleSearch = () => {
        const params = {
            keyword,
            media: "music",
            entity: "musicTrack",
            country: "jp",
            lang: "ja_jp",
            limit: "50"
        };
        // baseURLに設定したparamsを使ってgetリクエストを送信
        // axios.get(`https//itunes.apple.com/search?${qs.stringify(params)}}`);
    }

  return (
    <div>
        <input 
            type="text"
            className="search-input"
            value={keyword}
            onChange={(e)=>setKeyword(e.target.value)}
        />
        <button className="search-botton" onClick={handleSearch(keyword)}>検索</button>
    </div>
  )
}

export default Search
